	[12470] = {
		Title = "安德烈亚的报仇I",
		Description = {
			"\t\t\t安德烈亚被只到自己膝盖\的生物挥舞的镰刀而身负致命伤死亡，他希望可以让这个置自己于死地的小家伙同样感受死亡的安宁。\n\t\t\t\n\t\t\t^ff0000\"不可以被它可爱的外表给骗了，它比恶魔还可恶。\"^000000\n\t\t\t\n\t\t\t得亲自确认它是不是真的很可爱了。\n\t\t"
		},
		Summary = "击杀混沌小巴风特",
		RewardEXP = "1750000",
		RewardJEXP = "1137500",
		RewardItemList = {
			{ ItemID = 25271, ItemNum = 1 }
		}
	},
	[12471] = {
		Title = "安德烈亚的报仇II",
		Description = {
			"\t\t\t安德烈亚身受致命伤后虽尝试用自己的灵力治疗，却被这个混沌生物控制灵魂，只能放弃生命，他希望可以净化这个邪恶的生物。\n\t\t\t\n\t\t\t^ff0000\"应该是比我更早死亡的冒险家灵魂，不是的话又能怎么办?\"^000000\n\t\t\t\n\t\t\t无从得知安德烈亚生前是否也是个这么好战的祭司。\n\t\t"
		},
		Summary = "击杀混沌幽灵波利",
		RewardEXP = "1750000",
		RewardJEXP = "1137500",
		RewardItemList = {
			{ ItemID = 25271, ItemNum = 1 }
		}
	},
	[12472] = {
		Title = "艾妮丝的报仇I",
		Description = {
			"\t\t\t被这个快速又邪恶的昆虫逼向死亡的艾妮丝，遭受了决定性的致命一击，她深信在这个世界有翅膀的昆虫都应该被消灭。\n\t\t\t\n\t\t\t^ff0099\"不可以因为它长得像苍蝇就掉以轻心，它们的食物也包含「活人」…\"^000000\n\t\t\t\n\t\t\t不管怎么说，她对昆虫留有不怎么好的回忆。\n\t\t"
		},
		Summary = "击杀混沌赤苍蝇",
		RewardEXP = "1750000",
		RewardJEXP = "1137500",
		RewardItemList = {
			{ ItemID = 25271, ItemNum = 1 }
		}
	},
	[12473] = {
		Title = "艾妮丝的报仇II",
		Description = {
			"\t\t\t迷路的她被从草丛中窜出的残忍猎食者攻击、身受致命伤。可惜的是，这件事发生在她咬下为了探险早起准备的三明治那一刻。\n\t\t\t\n\t\t\t^ff0099\"如果发现那些可恶的家伙，我要把它们的腿都拔光、丢入淤泥中。\"^000000\n\n\t\t\t\n\t\t\t无论是谁，打断别人吃饭都会出大事。\n\t\t"
		},
		Summary = "击杀混沌狂暴螳螂",
		RewardEXP = "1750000",
		RewardJEXP = "1137500",
		RewardItemList = {
			{ ItemID = 25271, ItemNum = 1 }
		}
	},
	[12474] = {
		Title = "西尔瓦诺的报仇I",
		Description = {
			"\t\t\t西尔瓦诺他明确记得攻击自己、让自己面临濒死状态的人是谁。在他的记忆中，虽然和攻击小艾妮丝的魔物外型类似，但一定有不同特征。 \n\t\t\t\n\t\t\t^ff0077\"你问艾妮丝姊妹想要什么?她们也希望能够消灭它们，我也很想要拜托你这件事。\"^000000\n\t\t"
		},
		Summary = "击杀混沌螳螂",
		RewardEXP = "1750000",
		RewardJEXP = "1137500",
		RewardItemList = {
			{ ItemID = 25781, ItemNum = 1 }
		}
	},
	[12475] = {
		Title = "西尔瓦诺的报仇II",
		Description = {
			"\t\t\t濒临死亡的西尔瓦诺因为连念恢复咒语的时间都没有而打算服用药水，但他背包中的所有药水都被这软烂的魔物喝光了。\n\t\t\t\n\t\t\t^ff0077\"现在我的生活必需品又有什么用?现在我一无所有，只希望不再有冒险家受到相同的伤害。\"^000000\n\t\t\t\n\t\t\t实现他的小小希望，是下一个冒险家的工作。\n\t\t"
		},
		Summary = "击杀混沌波波利",
		RewardEXP = "1750000",
		RewardJEXP = "1137500",
		RewardItemList = {
			{ ItemID = 25782, ItemNum = 1 }
		}
	},
	[12476] = {
		Title = "圣西利亚的报仇I",
		Description = {
			"\t\t\t^0000ff\"请小心那条蛇，它比外表还要凶残。当你看到它的那一刻，它就会发动攻击。\"^000000\n\t\t\t\n\t\t\t圣西利亚因为暂时虚脱坐在位子时，被这个魔物咬了。她因为瞬间向身体扩散的麻w神经毒而一动也不能动。\n\t\t\t\n\t\t\t^0000ff\"我不会说在迷宫中想休息时不要休息。但如果我是活人的话，我会想避免...\"^000000\n\t\t"
		},
		Summary = "击杀混沌黑蛇",
		RewardEXP = "1750000",
		RewardJEXP = "1137500",
		RewardItemList = {
			{ ItemID = 25783, ItemNum = 1 }
		}
	},
	[12477] = {
		Title = "圣西利亚的报仇II",
		Description = {
			"\t\t\t在因麻w神经毒而无法动弹下被咬的她，因这个尖尖的魔物受了贯穿伤害。\n\t\t\t\n\t\t\t^0000ff\"被尖牙穿过的伤口逐渐愈合，但你懂手脚都不能用的心情吗?如果只是麻w状态的话我还能活下来，这都是因为那个死尖牙魔物!!\"^000000\n\t\t\t\n\t\t\t能够理解她的愤怒。\n\t\t"
		},
		Summary = "击杀混沌灰森灵",
		RewardEXP = "1750000",
